INSERT INTO components_home_mission_visions VALUES(2,'La Fundacin Afrocolombiana Profe en Casa | FACOPEC se dedica a captar y canalizar recursos a nivel local, nacional e internacional para desarrollar proyectos que promuevan y reivindiquen los derechos humanos de las comunidades negras, afrocolombianas, raizales y palenqueras.','about.mission','Ser reconocidos como una fundacin lder en la promocin de los derechos humanos y el desarrollo integral de las comunidades afrocolombianas, raizales y palenqueras.','about.vision');
INSERT INTO components_home_mission_visions VALUES(5,'La Fundacin Afrocolombiana Profe en Casa | FACOPEC se dedica a captar y canalizar recursos a nivel local, nacional e internacional para desarrollar proyectos que promuevan y reivindiquen los derechos humanos de las Comunidades NARP (Negras, Afrocolombianas, Raizales y Palenqueras).','about.mission','Ser reconocidos como una fundacin lder en la promocin de los derechos humanos y el desarrollo integral de las Comunidades NARP.','about.vision');
INSERT INTO components_home_mission_visions VALUES(8,'La Fundacin Afrocolombiana Profe en Casa | FACOPEC se dedica a captar y canalizar recursos a nivel local, nacional e internacional para desarrollar proyectos que promuevan y reivindiquen los derechos humanos de las Comunidades NARP (Negras, Afrocolombianas, Raizales y Palenqueras).','about.mission','Ser reconocidos como una fundacin lder en la promocin de los derechos humanos y el desarrollo integral de las Comunidades NARP.','about.vision');
INSERT INTO components_home_mission_visions VALUES(11,'La Fundacin Afrocolombiana Profe en Casa | FACOPEC se dedica a captar y canalizar recursos a nivel local, nacional e internacional para desarrollar proyectos que promuevan y reivindiquen los derechos humanos de las Comunidades NARP (Negras, Afrocolombianas, Raizales y Palenqueras). Trabajamos para empoderar a nios, nias, adolescentes, jvenes, hombres, mujeres y familias, potenciando sus capacidades y sueos mediante programas educativos, culturales, recreativos, y tecnolgicos, entre otros, con el fin de maximizar su impacto positivo y fomentar su desarrollo como actores de cambio en sus comunidades.','about.mission','Ser reconocidos como una fundacin lder en la promocin de los derechos humanos y el desarrollo integral de las Comunidades NARP. Aspiramos a crear un futuro donde estas comunidades puedan desplegar plenamente su potencial en mbitos tecnolgicos, educativos, culturales y sociales, contribuyendo activamente al progreso social, econmico y ambiental de Colombia y el mundo.','about.vision');
