INSERT INTO organization_infos VALUES(19,'y5jhn8pkz6y57265u2o6bylm','Fundacin Afrocolombiana Profe en Casa','Capta y canaliza recursos para desarrollar proyectos que promuevan y reivindiquen los derechos humanos de las Comunidades NARP (Negras, Afrocolombianas, Raizales y Palenqueras).','Ser una fundacin lder en el desarrollo integral de comunidades afrocolombianas, potenciando sus capacidades desde la educacin, la cultura y la fe.','<p>Desde Puerto Tejada, en el Cauca, acompaamos a nias, nios, adolescentes y sus familias con programas educativos, culturales y espirituales que transforman vidas.</p>','contacto@facopec.org','+57 321 523 0283',1763678341559,1763747275278,1763747275278,NULL,NULL,NULL,'https://www.canva.com/design/DAG5Qgbtdg8/YDQsqBd1PqH4WtBZybKmEQ/view?embed');
